def solve(length, width):
    if length == 0 or width == 0:
        return 0
    else:
        return length * width + solve(length - 1, width) + solve(length, width - 1) - solve(length - 1, width - 1)

def solve(length, width):
    count = 0
    for i in range(1, min(length, width) + 1):
        count += (length - i + 1) * (width - i + 1)
    return count

